// import ExpenseItem from "./ExpenseItem";

function Time(props){
    console.log(props) ;
    return (
       <div>
          <div>props.time.getFullYear()</div>
          <div>props.time.getMonth()</div>
          <div>props.time.getDate()</div>
       </div>
    );
}

export default Time;
